import React from "react";

function Home(){
    return(
        <div className="home">
            <div className="home-text-block">
                <h1 className="home-text-title">
                    Introduction   
                </h1>
            </div>
            <div className="home-picture-block"/>
        </div>
    );
}

export default Home
